// import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
// import Home from './Home';
import Layout from "./Layout";
import NavBar from "./Navbar";
import Sidebar from "./Sidebar";

function Login() {
  return (
    <div className="Login flex justify-center bg-gradient-to-r from-violet-500 to-fuchsia-500 h-screen">
      {/* <Layout> */}
        <form className="bg-gray-100 rounded-lg w-5/12 h-4/6 text-center mt-32">
          <div className="mt-16">
            <label className="my-6 pt-10 font-bold uppercase">E-mail</label><br/>
            <input className="pt-6 w-9/12 rounded-lg hover:bg-gradient-to-r from-violet-300 to-purple-300 hover:text-violet-700 border-r-violet-900" placeholder="email@example.com"/>
          </div>
          <div className="mt-16">
            <label className="my-6 pt-6 font-bold uppercase">Password</label><br/>
            <input className="pt-6 w-9/12 rounded-lg hover:bg-gradient-to-r from-violet-300 to-purple-300 hover:text-violet-700 border-r-violet-900" placeholder="Enter Password"/>
          </div>
          <div className="mt-16">
            <button className="font-bold bg-violet-700 w-32 p-4 rounded-lg hover:bg-gradient-to-r from-violet-800 to-purple-800 uppercase">Submit</button>
          </div>
        </form>
      {/* </Layout> */}
    </div>
    );
}

export default Login;
